import React from 'react'
import styled from 'styled-components'
import {Wrapper} from './Styled'

const AboutContainer = styled.section`
    Display:flex;
    height:100vh;
    @media (max-width: 45em) {
        flex-direction:column;
    }
`

const ImageContainer = styled.section`
    display:flex;
    align-item:center;
    justify-content:center;
    top:60px;
    height:100%;
    width:50%;
    background: linear-gradient(90deg, var(--primary) 50%, white 10em);
    @media (max-width: 45em) {
        width:100%;
        height:50%;
    }
`

const TextContainer = styled.section`
    height:100%;
    width:50%;
    Display:flex;
    background: grey;
    @media (max-width: 45em) {
        width:100%;
        height:50%;
    }
`

const Image = styled.div`
    height:20em;
    width:20em;
    border-radius:50%;
    background-color:black;
`

const Title = styled.h1``

const Text = styled.p``


export default function About() {
    return (
        <Wrapper>
            <AboutContainer>
                <ImageContainer>
                    <Image src=""/>
                </ImageContainer>
                <TextContainer>
                    <Title>
                    </Title>
                    <Text>
                    </Text>
                </TextContainer>
            </AboutContainer>
        </Wrapper>
    )
}
